                        <div class="rule-desc">
                            <p>
                                <font>
                                    <font>例如：</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>在本网站上，代理奖金是根据投注计算的。</font>
                                    <font>
                                        例如，如果投注额在10到20万之间，则相应的奖金率为70/10,000，如果投注额超过3,000,000，则代理商的奖金为110/10,000。</font>
                                    <font>A是该网站的代理人；</font>
                                    <font>招募B1、B2和B3作为他的代理人，B1还招募C1和C2作为他的代理人。</font>
                                    <font>B2 没有代理人，B3 只有一名代理人 C3。</font>
                                    <font>
                                        几天后，B1的有效投注为12万，B2的有效投注为4万，B3的有效投注为2万，C1的有效投注为10万，C2的有效投注为3万，C3的有效投注为300万。</font>
                                    <font>所以B1的总收益来自于C1和C2的13万，对应的佣金收益率为70/10,000；</font>
                                    <font>B2无次级业绩，因此佣金回报率为110/10,000；</font>
                                    <font>A有直接设备18万，其他设备313万，总回报331万，对应回报率为110/10000。
                                    </font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>因此，奖金计算如下：</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>1、直属团队：指垂直发展的成员，统称为直属团队。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>(1) B1、B2、B3 对 A 的贡献：(120,000+40,000+20,000) x
                                        110/10,000 = 1,980。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>(2) C1和C2对B1的贡献：(100,000+30,000) x 70/10,000 =
                                        910。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>(3) C3 对 B3 的贡献：300 万 x 110/10,000 = 33,000。
                                    </font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>2、其他团队：指发展下属、下属等的成员，统称为其他团队；</font>
                                    <font>由于该系统可以无限期地发展下属，为了更好地理解，本文以2层结构为例。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>
                                        （1）从C1和C2来看：由于B1的总收益为130,000，贴现率为70/10,000，而A的总收益为331万，贴现率为110/10,000。</font>
                                    <font>所以A和B1之间的折扣差是：110-70 =
                                        40/100,000，这个差是C1和C2对A的贡献，所以C1和C2对A的贡献是：(100,000+30,000) x 40/10,000 = 520。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>2、其他团队：指发展下属、下属等的成员，统称为其他团队；</font>
                                    <font>由于该系统可以无限期地发展下属，为了更好地理解，本文以2层结构为例。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>3、总结：</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>（1）C3实力强大，间接让A的整个业绩享受到更高比例的佣金回报。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>（2）如果下属没有发展，B2可能会比较懒，没有优势。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>
                                        （3）尽管加入较晚，属于A的下属，但B3的下属C3实力雄厚，让B3直接享受最高折扣率，而A无法直接赚取B3的差价。</font>
                                    <font>那么B3对于加盟的立场是谁呢？</font>
                                    <font>下属的利益，无论级别高低，绝不会受到影响；</font>
                                    <font>他们不会再遭受其他下属的损失，他们的发展也不会受到限制。</font>
                                </font>
                            </p>
                            <p>
                                <font>
                                    <font>（4）这是一种绝对公平的代理模式，不会总是对后来加入的人不利。</font>
                                </font>
                            </p>
